import NameItem from "./NameItem";
import styles from "./Name.module.css";

const Name=(props)=>{
   
    return (<div>
       <ul>
        {props.data.map((name) => <NameItem
            key={name.id}
            title={name.title}
            amount={name.amount}
            date={name.date}
          />
        )}
        </ul>
    </div>)
}
export default Name;
